template <class t>
void disp(vector<vector<t>> v)
{
	for(int i=0;i<v.size();i++)
	{
		for(int j=0;j<v[i].size();j++)
		{
			cout<<v[i][j]<<" ";
		}
		cout<<endl;
	}
}

template <class t>
void disp(vector<t> v)
{
	for(int i=0;i<v.size();i++)
	{
		cout<<v[i]<<" ";
	}
	cout<<endl;
}

void cycle(const vector<vector<int>> &v,vector<bool> &visi,vector<bool> &visited, int i,bool &ans)
{
	if(visi[i]==true)
	{
		ans=true;
		return;
	}
	visi[i]=true;
	for(int j=0;j<v[i].size();j++)
	{
		cycle(v,visi,visited,v[i][j],ans);
	}
	visi[i]=false;
	visited[i]=true;
}

bool ifcycle(vector<vector<int>> &v,int A)
{
	vector<bool> visited(v.size(),false);
    	bool ans=false;
    for(int i=1;i<=A;i++)
    {
    	if(visited[i]==false)
    	{
    		vector<bool> visi(v.size(),false);
    		cout<<"start "<<i<<endl;
    		cycle(v,visi,visited,i,ans);
    	}
    	if(ans)
    	{
    		disp(visited);
        	return true;
        }
    }
    return false;
}

void dfs_cycle(const vector<vector<int>> &v,int start,vector<bool> &grey,vector<bool> &white,bool &ans)
{
	if(grey[start]==true)
	{
		ans=true;
		return;
	}
	grey[start]=true;
	for(int j=0;j<v[start].size();j++)
	{
		if(grey[v[start][j]]==false)
		{
			dfs_cycle(v,v[start][j],grey,white,ans);
		}
	}
	grey[start]=false;
}

